description:
BreakQuest for Mac. Originally a Nurium Windows game, but ported to Mac by Red Marble Games. 


Will work on Mac OS 10.3 or above. Designed for PPC, but runs perfectly on Leopard with Intel.


No serial required - just open dmg and drag across the game.

